class Solution:
    def numSubarraysWithSum(self, nums: list[int], goal: int) -> int:
        result = 0
        #im gonna use the dynamic sliding window technique!
        
        start , end = 0 , 0
        length = len(nums)

        while start < length:
            sub = nums[start : end + 1]
            
            if (sum(sub) == goal):
                result += 1

                print(start, end)
                if (end == length  - 1):
                    start += 1
                    end = start
                else:
                    end += 1
            else:
                if (sum(sub) > goal):
                    start += 1
                    end = start
                else:
                    if (end == length):
                        start += 1
                        end = start
                    else:
                        end += 1
            
        return result


